import React, { Component } from 'react';
import {Link} from 'react-router-dom';
import TopBar from './TopBar';
import NavBar from './NavBar';

class Header extends Component {
    render() {
        return (
            <div>
                <TopBar/>
                <div className="container header">
                    <Link to="/">
                        <div className="logo">
                            <p className="logoName">GRETONG</p>
                            <img src="/img/logo_line.svg" alt="logo_line" className="logoImage"/>
                            <p className="logoDescription">ONLINE STORE</p>
                        </div>
                    </Link>
                    <div className="SSRC">
                        <button className="checkout">Checkout</button><br/>
                        <div className="search-container">
                            <input type="text" placeholder="Search" className="search"/>
                            <button type="submit"><i className="fa fa-search"></i></button>
                        </div>
                        <Link to="/cart"><button><i className="fas fa-cart-plus"/>  My Cart</button></Link>
                    </div>
                </div>
                <NavBar/>
            </div>
        );
    }
}

export default Header;
